-- CREATE DB

CREATE SCHEMA cloudbreak_cuisine;

-- CREATE TABLES
DROP TABLE IF EXISTS cloudbreak_cuisine.clusters;
CREATE TABLE cloudbreak_cuisine.clusters
(
  id integer unique NOT NULL PRIMARY KEY,
  version VARCHAR(50) NOT NULL,
  cluster_type VARCHAR(50) NOT NULL,
  template text
);

DROP TABLE IF EXISTS cloudbreak_cuisine.services;
CREATE TABLE cloudbreak_cuisine.services
(
  id integer unique NOT NULL PRIMARY KEY,
  service_description VARCHAR(50) NOT NULL,
  cluster_id integer NOT NULL,
  mandatory integer NOT NULL,
  extensible integer NOT NULL,
  display integer NOT NULL,
  img VARCHAR(200) NOT NULL,
  dependency VARCHAR(50)
);

DROP TABLE IF EXISTS cloudbreak_cuisine.recipes;
CREATE TABLE cloudbreak_cuisine.recipes
(
  id SERIAL PRIMARY KEY,
  serviceid integer,
  recipename text,
  recipedescription text,
  addon_type text,
  recipe_type text,
  mandatory integer,
  display integer,
  content text
);


DROP TABLE IF EXISTS cloudbreak_cuisine.services_dependencies;
CREATE TABLE cloudbreak_cuisine.services_dependencies
(
  id SERIAL NOT NULL PRIMARY KEY,
  service_id integer NOT NULL,
  service_description VARCHAR(50) NOT NULL,
  requires_service_id integer NOT NULL,
  required_service_description VARCHAR(50) NOT NULL
);

DROP TABLE IF EXISTS cloudbreak_cuisine.components_blueprints;
CREATE TABLE cloudbreak_cuisine.components_blueprints
(
  id integer unique NOT NULL PRIMARY KEY,
  service_id integer NOT NULL,
  component_description VARCHAR(50) NOT NULL,
  config text,
  master_blueprint text,
  worker_blueprint text,
  compute_blueprint text
);

DROP TABLE IF EXISTS cloudbreak_cuisine.components_recipes;
CREATE TABLE cloudbreak_cuisine.components_recipes
(
  id SERIAL NOT NULL PRIMARY KEY,
  service_id integer NOT NULL,
  recipe_description VARCHAR(50) NOT NULL,
  extra_type text,
  pre_ambari_start text,
  post_ambari_start text,
  post_cluster_install text,
  on_termination text
);

DROP TABLE IF EXISTS cloudbreak_cuisine.management_packs;
CREATE TABLE cloudbreak_cuisine.management_packs
(
  id integer unique NOT NULL PRIMARY KEY,
  cluster_id integer NOT NULL,
  description VARCHAR(255) NOT NULL,
  url text
);

DROP TABLE IF EXISTS cloudbreak_cuisine.external_bundles;
CREATE TABLE cloudbreak_cuisine.external_bundles
(
  id SERIAL NOT NULL PRIMARY KEY,
  name text,
  version text,
  description text,
  image text,
  download_url text
);


DROP TABLE IF EXISTS cloudbreak_cuisine.bundles;
CREATE TABLE cloudbreak_cuisine.bundles
(
  id SERIAL NOT NULL PRIMARY KEY,
  name text,
  description text,
  image text,
  type text
);

DROP TABLE IF EXISTS cloudbreak_cuisine.bundles_dependencies;
CREATE TABLE cloudbreak_cuisine.bundles_dependencies
(
  id SERIAL NOT NULL PRIMARY KEY,
  bundle_id integer,
  dep_type text,
  dep_id integer
);

DROP TABLE IF EXISTS cloudbreak_cuisine.bundles_contents;
CREATE TABLE cloudbreak_cuisine.bundles_contents
(
  id SERIAL NOT NULL PRIMARY KEY,
  bundle_id integer,
  type text,
  content text
);

DROP TABLE IF EXISTS cloudbreak_cuisine.whoville_bundles;
CREATE TABLE cloudbreak_cuisine.whoville_bundles
(
  id integer NOT NULL PRIMARY KEY,
  name text UNIQUE NOT NULL,
  description text,
  image text,
  type text
);


DROP TABLE IF EXISTS cloudbreak_cuisine.whoville_bundles_dependencies;
CREATE TABLE cloudbreak_cuisine.whoville_bundles_dependencies
(
  id integer NOT NULL PRIMARY KEY,
  bundle_id integer,
  dep_type text,
  dep_desc text
);


DROP TABLE IF EXISTS cloudbreak_cuisine.whoville_bundles_contents;
CREATE TABLE cloudbreak_cuisine.whoville_bundles_contents
(
  id integer NOT NULL PRIMARY KEY,
  bundle_id integer,
  type text,
  content text
);


DROP TABLE IF EXISTS cloudbreak_cuisine.whoville;
CREATE TABLE cloudbreak_cuisine.whoville
(
  id SERIAL NOT NULL PRIMARY KEY,
  name text,
  version text,
  description text,
  image text,
  download_url text
);

DROP TABLE IF EXISTS cloudbreak_cuisine.users;
CREATE TABLE cloudbreak_cuisine.users
(
  id SERIAL PRIMARY KEY,
  name text,
  username text,
  password text,
  email text,
  role text,
  img text
);


DROP TABLE IF EXISTS cloudbreak_cuisine.profiles;
CREATE TABLE cloudbreak_cuisine.profiles
(
  id SERIAL PRIMARY KEY,
  name text,
  user_name text,
  profile_type text,
  img text
);

DROP TABLE IF EXISTS cloudbreak_cuisine.whoville_profile;
CREATE TABLE cloudbreak_cuisine.whoville_profile
(
  id integer PRIMARY KEY,
  profile_id integer,
  namespace text,
  user_mode text,
  cb_url text,
  default_user text,
  default_email text,
  default_pwd text
);

DROP TABLE IF EXISTS cloudbreak_cuisine.whoville_profile_tags;
CREATE TABLE cloudbreak_cuisine.whoville_profile_tags
(
  id integer PRIMARY KEY,
  whoville_profile_id integer,
  tag_name text,
  tag_value text
);
DROP TABLE IF EXISTS cloudbreak_cuisine.whoville_profile_credentials;
CREATE TABLE cloudbreak_cuisine.whoville_profile_credentials
(
  id integer PRIMARY KEY,
  whoville_profile_id integer,
  type text,
  type_img text,
  provider text,
  region text,
  bucket text,
  bucket_role text
);




